import React from "react";
import { styled } from "@mui/material/styles";
import { Grid } from "@mui/material";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";

import profileImage from "./img/rectangle11610.png";
import "./style/register.css";
import { flexbox } from "@mui/system";

const Register = () => {
  return (
    <Box className="page-body">
      <Box
        className="frame-register"
        sx={{
          display: "flex",
          flexDirection: "row",
        }}
      >
        <Box className="frame-img" sx={{ marginRight: "70px" }}>
          <div className="profile-img">
            <img src={profileImage} alt="img" />
          </div>
          <div className="profile-text">Изменить фото</div>
        </Box>
        <Box width={"600px"} mt={5}>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "baseline",
            }}
          >
            <Typography variant="body1" gutterBottom mr={6}>
              Firstname
            </Typography>
            <TextField
              fullWidth
              id="outlined-basic"
              label="Enter fullname"
              variant="outlined"
            />
          </Box>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "baseline",
            }}
          >
            <Typography variant="body1" gutterBottom mr={6}>
              Firstname
            </Typography>
            <TextField
              fullWidth
              id="outlined-basic"
              label="Enter fullname"
              variant="outlined"
            />
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default Register;
